import find from '../../images/find.svg';
import React from 'react';
import './SearchForm.css';

function SearchForm() {

    return (
        <section className="searchForm">
            <div className="searchForm__container">
                <input id="user-input" className="searchForm__input" name="user-input" type="text" placeholder="Фильм" />
                <button id="search-btn" className="searchForm__find" aria-label="Кнопка поиска" type="submit">
                    <img src={find} alt="Логотип" />
                </button>
            </div>
            <div className="searchForm__filter">
                <label className="searchForm__filter-checkbox">Только короткометражки</label>
                <input id="filter-input" className="searchForm__filter-input" name="filter-input" type="checkbox" />
            </div>
        </section>
    );
}

export default SearchForm;
